import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import TextareaAutosize from '@material-ui/core/TextareaAutosize';
import CssBaseline from '@material-ui/core/CssBaseline';
import Container from '@material-ui/core/Container';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import PlayArrowIcon from '@material-ui/icons/PlayArrow';
import PinDropIcon from '@material-ui/icons/PinDrop';
import RoomIcon from '@material-ui/icons/Room';
import Slider from '@material-ui/core/Slider';

const useStyles = makeStyles((theme) => ({
  root: {
    width: 300,
  },
  margin: {
    height: theme.spacing(3),
  },
}));

const marks = [
  {
    value: 0,
    label: '0°C',
  },
  {
    value: 20,
    label: '20°C',
  },
  {
    value: 37,
    label: '37°C',
  },
  {
    value: 100,
    label: '100°C',
  },
];

function valuetext(value) {
  return `${value}°C`;
}

export default function Questions() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className={classes.root}>
      <Container>
        <Grid container spacing={3}>
        <Grid item xs={12}>
          <Paper className={classes.paper}><PlayArrowIcon /><Typography id="discrete-slider-always" gutterBottom>
      </Typography>
      <Slider
        defaultValue={80}
        getAriaValueText={valuetext}
        aria-labelledby="discrete-slider-always"
        step={10}
        marks={marks}
        valueLabelDisplay="on"
        fullWidth
      /></Paper>
        </Grid>
        <Grid item xs={12} sm={6}>
          hello
        </Grid>
        <Grid item xs={12} sm={6}>


      <Typography variant="h5">
        The session was pinned at 5:10
      </Typography>
      <Typography> Notes for me</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        <Typography > To share with Julia:</Typography>
        <Typography> What is your perspective of what happened at this pin?</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        <Typography> What would you categorize this pin as?</Typography>
        <ButtonGroup disableElevation variant="contained" color="primary">
            <Button>Strength</Button>
            <Button>Opportunity</Button>
        </ButtonGroup>  

      <Typography variant="h5">
        The session was pinned at 14:13
      </Typography>
      <Typography> Notes for me</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        <Typography > To share with Julia:</Typography>
        <Typography> What is your perspective of what happened at this pin?</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        <Typography> What would you categorize this pin as?</Typography>
        <ButtonGroup disableElevation variant="contained" color="primary">
            <Button>Strength</Button>
            <Button>Opportunity</Button>
        </ButtonGroup>  

      <Typography variant="h5">
        The session was pinned at 22:21
      </Typography>
      <Typography> Notes for me</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        <Typography > To share with Julia:</Typography>
        <Typography> What is your perspective of what happened at this pin?</Typography>
        <TextareaAutosize aria-label="minimum height" rowsMin={3} placeholder="Minimum 3 rows" />
        <Typography> What would you categorize this pin as?</Typography>
        <ButtonGroup disableElevation variant="contained" color="primary">
            <Button>Strength</Button>
            <Button>Opportunity</Button>
        </ButtonGroup>  
      </Grid>
      </Grid>
      </Container>
    </div>
  );
}
